import data from './shop.data'
import { __ } from 'lodash'

const INITIAL_STATE = {
    collections: __.mapKeys(data, 'name')
}

const shopReducer = (state = INITIAL_STATE, action) => {
    switch(action.type) {
        default: return state
    }
}

export default shopReducer
